class Solution {
    public List<Integer> sum_product(List<Integer> numbers) {
        int sum = 0;
        int product = 1;

        for (int num : numbers) {
            sum += num;
            product *= num;
        }

        if (numbers.isEmpty()) {
            sum = 0;
            product = 1;
        }

        return Arrays.asList(sum, product);
    }
}

