class Solution {
    public List<Double> find_closest_elements(List<Double> numbers) {
        List<Double> closest_pair = new ArrayList<>();
        closest_pair.add(numbers.get(0));
        closest_pair.add(numbers.get(1));
        double min_distance = Math.abs(numbers.get(1) - numbers.get(0));

        for (int i = 0; i < numbers.size(); i++) {
            for (int j = i + 1; j < numbers.size(); j++) {
                double current_distance = Math.abs(numbers.get(i) - numbers.get(j));
                if (current_distance < min_distance) {
                    closest_pair.clear();
                    closest_pair.add(numbers.get(i));
                    closest_pair.add(numbers.get(j));
                    min_distance = current_distance;
                }
            }
        }

        Collections.sort(closest_pair);
        return closest_pair;
    }
}

