class Solution {
    public int largest_divisor(int n) {
        for (int i = n / 2; i > 0; i--) {
            if (n % i == 0) {
                return i;
            }
        }
        return 1; // In case n is 1, the largest divisor is 1.
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.largest_divisor(3) == 1,
                s.largest_divisor(7) == 1,
                s.largest_divisor(10) == 5,
                s.largest_divisor(100) == 50,
                s.largest_divisor(49) == 7
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

