    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.is_prime(6),
                s.is_prime(101),
                s.is_prime(11),
                s.is_prime(13441),
                s.is_prime(61),
                !s.is_prime(4),
                !s.is_prime(1),
                s.is_prime(5),
                s.is_prime(11),
                s.is_prime(17),
                !s.is_prime(5 * 17),
                !s.is_prime(11 * 7),
                !s.is_prime(13441 * 19)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

