import java.util.*;
import java.lang.*;

class Solution {
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    public double find_zero(List<Double> xs) {
        // Ensure the list has an even number of coefficients
        if (xs.size() % 2 != 0) {
            throw new IllegalArgumentException("The list must have an even number of coefficients.");
        }

        // Find the interval where the polynomial changes sign
        double a = -1.0;
        double b = 1.0;
        while (poly(xs, a) * poly(xs, b) > 0) {
            a *= 2;
            b *= 2;
        }

        // Use binary search to find the zero point
        double tolerance = 1e-10;
        while (b - a > tolerance) {
            double mid = (a + b) / 2;
            if (poly(xs, mid) * poly(xs, a) > 0) {
                a = mid;
            } else {
                b = mid;
            }
        }

        return (a + b) / 2;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
            int ncoeff = 2 * (rand.nextInt(3) + 1);
            List<Double> coeffs = new ArrayList<>();
            for (int j = 0; j < ncoeff; j++) {
                int coeff = rand.nextInt(20) - 10;
                if (coeff == 0) {
                    coeff = 1;
                }
                coeffs.add((double) coeff);
            }
            double solution = s.find_zero(coeffs);
            if (Math.abs(s.poly(coeffs, solution)) > 1e-4) {
                throw new AssertionError();
            }
        }
    }
}

