        // Find the interval where the polynomial changes sign
        double a = -1000; // Start with a large negative number
        double b = 1000;  // Start with a large positive number
        double fa = poly(xs, a);
        double fb = poly(xs, b);

        // Ensure the polynomial changes sign in the interval [a, b]
        if (fa * fb > 0) {
            throw new IllegalArgumentException("The polynomial does not change sign in the interval.");
        }

        // Use binary search to find the zero
        double tolerance = 1e-7;
        while ((b - a) > tolerance) {
            double c = (a + b) / 2;
