class Solution {
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    public double find_zero(List<Double> xs) {
        // Ensure the list has an even number of coefficients
        if (xs.size() % 2 != 0) {
            throw new IllegalArgumentException("The list must have an even number of coefficients.");
        }

