            a *= 2;
            b *= 2;
        }

        // Use binary search to find the zero point
        double tolerance = 1e-10;
        while (b - a > tolerance) {
            double mid = (a + b) / 2;
            if (poly(xs, mid) * poly(xs, a) > 0) {
                a = mid;
            } else {
                b = mid;
            }
        }

        return (a + b) / 2;
    }
}

