                s.is_palindrome("aaaaa"),
                !s.is_palindrome("zbcd"),
                s.is_palindrome("xywyx"),
                !s.is_palindrome("xywyz"),
                !s.is_palindrome("xywzx")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

