class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        List<Integer> result = new ArrayList<>();
        if (arr.isEmpty()) {
            return result;
        }

        int smallestEven = Integer.MAX_VALUE;
        int smallestIndex = -1;

        for (int i = 0; i < arr.size(); i++) {
            int value = arr.get(i);
            if (value % 2 == 0 && value < smallestEven) {
                smallestEven = value;
                smallestIndex = i;
            }
        }

        if (smallestIndex != -1) {
            result.add(smallestEven);
            result.add(smallestIndex);
        }

        return result;
    }
}

