class Solution {
    public boolean is_multiply_prime(int a) {
        // Helper function to check if a number is prime
        boolean[] isPrime = new boolean[100];
        Arrays.fill(isPrime, true);
        isPrime[0] = isPrime[1] = false; // 0 and 1 are not prime numbers

        for (int i = 2; i * i < 100; i++) {
            if (isPrime[i]) {
                for (int j = i * i; j < 100; j += i) {
                    isPrime[j] = false;
                }
            }
        }

        // Check if the number can be expressed as a product of three primes
        for (int i = 2; i < 100; i++) {
            if (isPrime[i]) {
                for (int j = i; j < 100; j++) {
                    if (isPrime[j]) {
                        int k = a / (i * j);
                        if (k < 100 && isPrime[k] && i * j * k == a) {
                            return true;
                        }
                    }
                }
            }
        }
        return false;
    }
}

