class Solution {
    public int starts_one_ends(int n) {
        // There are 2^(n-1) numbers that start with 1 and 2^(n-1) numbers that end with 1
        // However, the number 1 followed by (n-1) zeros is counted in both sets, so we subtract 1
        return (int) (Math.pow(2, n - 1) + Math.pow(2, n - 1) - 1);
    }
}

