class Solution {
    public int starts_one_ends(int n) {
        // There are 10 possible digits for each position (0-9)
        // For n-digit numbers, there are 10^(n-1) possible numbers
        // We need to count numbers that start or end with 1

        // Numbers starting with 1: 1 followed by (n-1) digits
        int startWithOne = (int) Math.pow(10, n - 1);

        // Numbers ending with 1: 1 preceded by (n-1) digits
        int endWithOne = (int) Math.pow(10, n - 1);

        // Numbers starting and ending with 1: 1 followed by (n-2) digits and ending with 1
        int startAndEndWithOne = (n > 1) ? (int) Math.pow(10, n - 2) : 0;

        // Use inclusion-exclusion principle to avoid double counting
        return startWithOne + endWithOne - startAndEndWithOne;
    }
}

