class Solution {
    public Optional<Integer> next_smallest(List<Integer> lst) {
        if (lst.size() < 2) {
            return Optional.empty();
        }

        int smallest = Integer.MAX_VALUE;
        int secondSmallest = Integer.MAX_VALUE;
        boolean foundSecondSmallest = false;

        for (int num : lst) {
            if (num < smallest) {
                secondSmallest = smallest;
                smallest = num;
            } else if (num > smallest && num < secondSmallest) {
                secondSmallest = num;
                foundSecondSmallest = true;
            }
        }

        return foundSecondSmallest ? Optional.of(secondSmallest) : Optional.empty();
    }
}

