class Solution {
    public int skjkasdkd(List<Integer> lst) {
        int largestPrime = -1;

        // Find the largest prime number in the list
        for (int num : lst) {
            if (isPrime(num) && num > largestPrime) {
                largestPrime = num;
            }
        }

        // If no prime number is found, return 0
        if (largestPrime == -1) {
            return 0;
        }

        // Calculate the sum of the digits of the largest prime number
        int sumOfDigits = 0;
        while (largestPrime > 0) {
            sumOfDigits += largestPrime % 10;
            largestPrime /= 10;
        }

        return sumOfDigits;
    }

    // Helper method to check if a number is prime
    private boolean isPrime(int num) {
        if (num <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }
        return true;
    }
}

