class Solution {
    public int count_upper(String s) {
        int count = 0;
        Set<Character> vowels = new HashSet<>(Arrays.asList('A', 'E', 'I', 'O', 'U'));

        for (int i = 0; i < s.length(); i += 2) {
            if (vowels.contains(s.charAt(i))) {
                count++;
            }
        }

        return count;
    }
}

