class Solution {
    public Object rounded_avg(int n, int m) {
        if (n > m) {
            return -1;
        }

        int sum = 0;
        for (int i = n; i <= m; i++) {
            sum += i;
        }

        int count = m - n + 1;
        int average = (int) Math.round((double) sum / count);
        return Integer.toBinaryString(average);
    }
}

