class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (int num : arr) {
            int sum = 0;
            int absNum = Math.abs(num);
            while (absNum > 0) {
                sum += absNum % 10;
                absNum /= 10;
            }
            if (num < 0) {
                sum = -sum;
            }
            if (sum > 0) {
                count++;
            }
        }
        return count;
    }
}

