class Solution {
    public String get_closest_vowel(String word) {
        Set<Character> vowels = new HashSet<>(Arrays.asList('a', 'e', 'i', 'o', 'u', 'A', 'E', 'I', 'O', 'U'));
        Set<Character> consonants = new HashSet<>(Arrays.asList('b', 'c', 'd', 'f', 'g', 'h', 'j', 'k', 'l', 'm', 'n', 'p', 'q', 'r', 's', 't', 'v', 'w', 'x', 'y', 'z',
                                                                'B', 'C', 'D', 'F', 'G', 'H', 'J', 'K', 'L', 'M', 'N', 'P', 'Q', 'R', 'S', 'T', 'V', 'W', 'X', 'Y', 'Z'));

        for (int i = word.length() - 2; i > 0; i--) {
            if (vowels.contains(word.charAt(i)) && consonants.contains(word.charAt(i + 1)) && consonants.contains(word.charAt(i - 1))) {
                return String.valueOf(word.charAt(i));
            }
        }
        return "";
    }
}

