class Solution {
    public String match_parens(List<String> lst) {
        int openCount1 = 0, closeCount1 = 0;
        int openCount2 = 0, closeCount2 = 0;

        // Count open and close parentheses in the first string
        for (char c : lst.get(0).toCharArray()) {
            if (c == '(') {
                openCount1++;
            } else {
                closeCount1++;
            }
        }

        // Count open and close parentheses in the second string
        for (char c : lst.get(1).toCharArray()) {
            if (c == '(') {
                openCount2++;
            } else {
                closeCount2++;
            }
        }

        // Check if we can balance the parentheses
        if (Math.abs(openCount1 - closeCount1) == Math.abs(openCount2 - closeCount2)) {
            return "Yes";
        } else {
            return "No";
        }
    }
