    public List<Integer> get_odd_collatz(int n) {
        List<Integer> oddNumbers = new ArrayList<>();
        while (n != 1) {
            if (n % 2 != 0) {
                oddNumbers.add(n);
            }
            if (n % 2 == 0) {
                n = n / 2;
            } else {
                n = 3 * n + 1;
            }
        }
        oddNumbers.add(1); // Adding the last number in the sequence which is always 1
        Collections.sort(oddNumbers);
        return oddNumbers;
    }
}

