        List<Integer> result = new ArrayList<>();
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < a.length; i++) {
                if (a[i] != b[i]) return a[i] - b[i];
            }
            return 0;
        });

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                pq.offer(new int[]{grid.get(i).get(j), i, j});
            }
        }

        while (!pq.isEmpty()) {
            int[] current = pq.poll();
            int value = current[0];
            int x = current[1];
            int y = current[2];
            List<Integer> path = new ArrayList<>();
            path.add(value);
            boolean[][] visited = new boolean[n][n];
            visited[x][y] = true;
            dfs(grid, k, x, y, path, visited, directions, pq);
            if (path.size() == k) {
                result = path;
                break;
            }
        }

        return result;
    }

