class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        int[][] directions = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
        List<Integer> result = new ArrayList<>();
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < a.length; i++) {
                if (a[i] != b[i]) return a[i] - b[i];
            }
            return 0;
        });

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                pq.offer(new int[]{grid.get(i).get(j), i, j});
            }
        }

        while (!pq.isEmpty()) {
            int[] current = pq.poll();
            int value = current[0];
            int x = current[1];
            int y = current[2];
            List<Integer> path = new ArrayList<>();
            path.add(value);
            boolean[][] visited = new boolean[n][n];
            visited[x][y] = true;
            dfs(grid, x, y, k, path, visited, directions, pq);
            if (path.size() == k) {
                result = path;
                break;
            }
        }

        return result;
    }

    private void dfs(List<List<Integer>> grid, int x, int y, int k, List<Integer> path, boolean[][] visited, int[][] directions, PriorityQueue<int[]> pq) {
        if (path.size() == k) return;
        for (int[] dir : directions) {
            int newX = x + dir[0];
            int newY = y + dir[1];
            if (newX >= 0 && newX < grid.size() && newY >= 0 && newY < grid.size() && !visited[newX][newY]) {
                visited[newX][newY] = true;
                path.add(grid.get(newX).get(newY));
                dfs(grid, newX, newY, k, path, visited, directions, pq);
                if (path.size() == k) return;
                path.remove(path.size() - 1);
                visited[newX][newY] = false;
            }
        }
    }
}

