class Solution {
    public Optional<Object> compare_one(Object a, Object b) {
        // Normalize the input to handle different representations
        double numA = normalize(a);
        double numB = normalize(b);

        // Compare the normalized values
        if (numA > numB) {
            return Optional.of(a);
        } else if (numB > numA) {
            return Optional.of(b);
        } else {
            return Optional.empty();
        }
    }

    private double normalize(Object obj) {
        if (obj instanceof Integer) {
            return (Integer) obj;
        } else if (obj instanceof Double) {
            return (Double) obj;
        } else if (obj instanceof String) {
            String str = (String) obj;
            str = str.replace(',', '.'); // Normalize the decimal separator
            return Double.parseDouble(str);
        }
        throw new IllegalArgumentException("Unsupported type");
    }
}

