                s.sum_squares(Arrays.asList(1,1,1,1,1,1,1,1,1)) == 9,
                s.sum_squares(Arrays.asList(-1,-1,-1,-1,-1,-1,-1,-1,-1)) == -3,
                s.sum_squares(List.of(0)) == 0,
