class Solution {
    public String file_name_check(String file_name) {
        // Check if there are more than three digits
        int digitCount = 0;
        for (char c : file_name.toCharArray()) {
            if (Character.isDigit(c)) {
                digitCount++;
                if (digitCount > 3) {
                    return "No";
                }
            }
        }

        // Check if there is exactly one dot
        int dotIndex = file_name.indexOf('.');
        if (dotIndex == -1 || dotIndex != file_name.lastIndexOf('.')) {
            return "No";
        }

        // Check if the substring before the dot is not empty and starts with a latin letter
        String namePart = file_name.substring(0, dotIndex);
        if (namePart.isEmpty() || !Character.isLetter(namePart.charAt(0))) {
            return "No";
        }

        // Check if the substring after the dot is one of the allowed extensions
        String extension = file_name.substring(dotIndex + 1);
        List<String> allowedExtensions = Arrays.asList("txt", "exe", "dll");
        if (!allowedExtensions.contains(extension)) {
            return "No";
        }

        return "Yes";
    }
}

