    public String file_name_check(String file_name) {
        int dotIndex = file_name.indexOf('.');
        if (dotIndex == -1 || dotIndex == 0 || dotIndex != file_name.lastIndexOf('.')) {
            return "No";
        }

        String beforeDot = file_name.substring(0, dotIndex);
        String afterDot = file_name.substring(dotIndex + 1);

        if (!beforeDot.matches("[a-zA-Z][a-zA-Z0-9]*") || beforeDot.replaceAll("[0-9]", "").length() < beforeDot.length() - 3) {
            return "No";
        }

        if (!afterDot.matches("txt|exe|dll")) {
            return "No";
        }

        return "Yes";
    }
}

