class Solution {
    public int get_max_triples(int n) {
        int[] a = new int[n];
        for (int i = 0; i < n; i++) {
            a[i] = (i + 1) * (i + 1) - (i + 1) + 1;
        }

        int count = 0;
        for (int i = 0; i < n - 2; i++) {
            for (int j = i + 1; j < n - 1; j++) {
                for (int k = j + 1; k < n; k++) {
                    if ((a[i] + a[j] + a[k]) % 3 == 0) {
                        count++;
                    }
                }
            }
        }
        return count;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.get_max_triples(5) == 1,
                s.get_max_triples(6) == 4,
                s.get_max_triples(10) == 36,
                s.get_max_triples(100) == 53361
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

