class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        Collections.sort(nums, new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                int sumA = sumOfDigits(a);
                int sumB = sumOfDigits(b);
                return sumA != sumB ? Integer.compare(sumA, sumB) : Integer.compare(nums.indexOf(a), nums.indexOf(b));
            }
        });
        return nums;
    }

    private int sumOfDigits(int num) {
        int sum = 0;
        num = Math.abs(num);
        while (num > 0) {
            sum += num % 10;
            num /= 10;
        }
        return sum;
    }
}

