class Solution {
    public boolean right_angle_triangle(int a, int b, int c) {
        // Sort the sides to ensure a <= b <= c
        int[] sides = {a, b, c};
        Arrays.sort(sides);

        // Check the Pythagorean theorem
        return sides[0] * sides[0] + sides[1] * sides[1] == sides[2] * sides[2];
    }
