class Solution {
    public String int_to_mini_roman(int number) {
        // Define the Roman numeral symbols and their corresponding values
        int[] values = {1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1};
        String[] symbols = {"m", "cm", "d", "cd", "c", "xc", "l", "xl", "x", "ix", "v", "iv", "i"};

        StringBuilder roman = new StringBuilder();

        // Iterate through the values and symbols arrays
        for (int i = 0; i < values.length; i++) {
            // Append the symbol while the number is greater than or equal to the value
            while (number >= values[i]) {
                roman.append(symbols[i]);
                number -= values[i];
            }
        }

        // Convert the result to lowercase and return
        return roman.toString();
    }
}

